with open('coordinates_india.csv', 'w', newline='', encoding='utf-8') as file:
    writer = csv.writer(file)
    writer.writerow(["Toll Plaza Name", "Latitude", "Longitude"])  # Write headers
    
    # Open another file to save the names where coordinates couldn't be found
    with open('unfound_coordinates.txt', 'w', encoding='utf-8') as unfound_file:
        
        # Loop through each toll plaza name
        for toll_plaza in toll_plaza_names:
            name = toll_plaza.get_text().strip()
            if name:  # Skip if there's no name
                try:
                    # Geocode the name to get latitude and longitude
                    geocode_result = gmaps.geocode(name + ", India")  # Add ", India" to restrict search to India

                    if geocode_result:
                        # Check if the result's address contains 'India'
                        address_components = geocode_result[0]['address_components']
                        country = None
                        
                        for component in address_components:
                            if 'country' in component['types']:
                                country = component['long_name']
                                break
                        
                        # Only save the result if it is in India
                        if country and 'India' in country:
                            latitude = geocode_result[0]['geometry']['location']['lat']
                            longitude = geocode_result[0]['geometry']['location']['lng']
                            # Write the toll plaza name and its coordinates to the CSV
                            writer.writerow([name, latitude, longitude])
                            print(f"Saved {name}: {latitude}, {longitude}")
                        else:
                            print(f"{name} is not located in India")
                            # Write the name to the unfound file
                            unfound_file.write(name + '\n')
                    else:
                        print(f"Could not find coordinates for {name}")
                        # Write the name to the unfound file
                        unfound_file.write(name + '\n')
                except Exception as e:
                    print(f"Error with {name}: {e}")
                    # Write the name to the unfound file in case of error
                    unfound_file.write(name + '\n')

print("Toll plaza data saved to 'coordinates_india.csv' and unfound names saved to 'unfound_coordinates.txt'")